import { useState, useEffect } from "react";
import "./Header.css"; // make sure this file exists

const Header = () => {
  const [isMenuActive, setIsMenuActive] = useState(false);

  const toggleMenu = () => {
    setIsMenuActive(!isMenuActive);
  };

  useEffect(() => {
    if (isMenuActive) {
      document.body.classList.add("overflow-hidden");
    } else {
      document.body.classList.remove("overflow-hidden");
    }

    return () => {
      document.body.classList.remove("overflow-hidden");
    };
  }, [isMenuActive]);

  useEffect(() => {
    const handleScroll = () => {
      const header = document.querySelector(".header-area");
      if (window.scrollY > 50) {
        header.classList.add("header-area-active");
      } else {
        header.classList.remove("header-area-active");
      }
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <header className="header-area">
      <div className="common-wrap">
        <div className="header-wrap">
          <div className="container">
            <div className="row align-items-center">
              <div className="col-lg-2 col-5">
                <div className="header-logo">
                  <a href="#">
                    <img src="assets/logo.svg" alt="img" />
                  </a>
                </div>
              </div>

              <div className="col-lg-6 d-lg-block d-none">
                <div className="header-nav">
                  <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/AanbodDtl">Aanbod</a></li>
                    <li><a href="/Dienstenlist">Diensten</a></li>
                    <li><a href="/Werkplaats">Werkplaats</a></li>
                    <li><a href="/OverOns">Over ons</a></li>
                  </ul>
                </div>
              </div>

              <div className="col-lg-2">
                <div className="bovag-logo">
                  <img src="assets/bovag-logo.svg" alt="Bovag Logo" />
                </div>
              </div>

              <div className="col-lg-2 col-7">
                <div className="header-right text-end">
                  <a href="" className="login">Inloggen</a>
                  <a href="/Contact" className="common-btn">Contact</a>

                  {/* Hamburger / Close Icon */}
                  <div className="menu-bar d-lg-none d-block">
                    <button
                      className={`menu-toggle ${isMenuActive ? "active" : ""}`}
                      onClick={toggleMenu}
                      aria-label="Toggle menu"
                    >
                      {isMenuActive ? (
                        <span className="close-icon">&times;</span>
                      ) : (
                        <span className="hamburger-icon">
                          <span></span>
                          <span></span>
                          <span></span>
                        </span>
                      )}
                    </button>
                  </div>
                </div>
              </div>
            </div>

            {/* Mobile Menu */}
            <div
              className={`mobile-header-menu ${
                isMenuActive ? "mob-menu-active" : ""
              }`}
            >
              <div className="mobile-header-menu-wrap">
                <ul>
                  {["Home", "Aanbod", "Diensten", "Werkplaats", "Over ons"].map(
                    (item, index) => (
                      <li
                        key={index}
                        className={isMenuActive ? "active" : ""}
                        style={{
                          animationDelay: `${0.2 * (1 + index)}s`,
                        }}
                      >
                        <a href="#" onClick={() => setIsMenuActive(false)}>
                          {item}
                        </a>
                      </li>
                    )
                  )}
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
